import { db, auth, loadData } from './firebase.js';
import { onAuthStateChanged, signInWithPopup, GoogleAuthProvider, signOut } from "https://www.gstatic.com/firebasejs/10.7.1/firebase-auth.js";
import { ref, set, remove } from "https://www.gstatic.com/firebasejs/10.7.1/firebase-database.js";

let currId;

async function initPage() {
    onAuthStateChanged(auth, async (user) => {
        if (user) {
            console.log(user.displayName);
            
            $('#btnLogin').hide();
            $('#btnLogout').show();

            $('#matchlogSelect, #addLogBtn, #matchlogBtn, #matchNum, #matchlogList').show();
            $('#matchStatList').hide();
            $('#matchNum').css('display', 'flex');

            try {
                const [dataA, matchlog] = await Promise.all([
                    loadData('dataA'),
                    loadData(`matchlog/${user.uid}`) 
                ]);

                render(dataA, matchlog || {}, user.uid); 

            } catch (error) {
                console.error('데이터 불러오기 실패:', error);
            }
        } else {
            console.log("로그인이 필요합니다.");
            
            $('#btnLogin').css('display', 'block');
            $('#btnLogout').css('display', 'none');

            $('#matchlogSelect, #addLogBtn, #matchlogBtn, #matchNum, #matchlogList, #matchStatList').css('display', 'none');
        }

        afterLoading();
    });
}

// 로그인
$('#btnLogin').click(async function() {
    const provider = new GoogleAuthProvider();
    try {
        await signInWithPopup(auth, provider);
    } catch (error) {
        console.error("로그인 실패:", error);
    }
});

// 로그아웃
$('#btnLogout').click(async function() {
    if (confirm("로그아웃하시겠습니까?")) {
        try {
            await signOut(auth);
        } catch (error) {
            console.error("로그아웃 실패:", error);
        }
    }
});

initPage();

function render(data, matchlog, uid) {
    let year = 0;

    // 버튼 기능
    $('#matchlogSelect').append(`<option value='0'>전체</option>`);
    for (let i = new Date().getFullYear(); i >= 2015; i--) {
        $('#matchlogSelect').append(`<option value='${i}'>${i}</option>`);
    }

    $(`option[value='0']`).prop('selected', true);

    $('#matchlogSelect').on('change', function() {
        $(this).blur();

        year = $(this).val();
        getList(data, matchlog, year);
    });

    getList(data, matchlog, 0);

    // 일정 클릭하면 기록 띄우기
    $(document).off('click', '#matchlogList > div').on('click', '#matchlogList > div', function() {
        $('#log, #logBg').hide().fadeIn(300);
        $('body').css('overflow', 'hidden');

        let matchId = $(this).attr('id');
        getLog(data, matchlog, matchId);
    });

    $('#logBg').click(function() {
        $('#log, #logBg').fadeOut(300);
        $('body').css('overflow', 'auto');
    })

    // 기록 추가
    $('#addLogBtn').click(function() {
        $('#addLog, #addLogBg').hide().fadeIn(300);
        $('body').css('overflow', 'hidden');

        addLog(data, matchlog, uid);
    })

    $('#addLogBg').click(function() {
        $('#addLog, #addLogBg').fadeOut(300);
        $('body').css('overflow', 'auto');
    })

    // 버튼 클릭 이벤트
    $('#matchlogBtn > button:nth-of-type(1)').click(function () {
        $('#matchlogBtn > button:nth-of-type(1)').css({ 'background': '#000060c0', 'color': '#faf6f5' });
        $('#matchlogBtn > button:nth-of-type(2)').css({ 'background': '#faf6f540', 'color': '#05090a' });

        $('#matchlogList').show();
        $('#matchStatList').hide();
    });

    $('#matchlogBtn > button:nth-of-type(2)').click(function () {
        $('#matchlogBtn > button:nth-of-type(1)').css({ 'background': '#faf6f540', 'color': '#05090a' });
        $('#matchlogBtn > button:nth-of-type(2)').css({ 'background': '#000060c0', 'color': '#faf6f5' });

        $('#matchlogList').hide();
        $('#matchStatList').show();
        
        $('.gauge-text > span').text(0);
        $('.meter').css({ 'transition': 'none', 'stroke-dasharray': '0 283' });

        const keys = (year == 0) ? Object.keys(data) : Object.keys(data).filter(y => y.substring(0, 4) == year);
        const { w, d, l } = window.currentStats || { w: 0, d: 0, l: 0 };

        setTimeout(() => {
            setGauge(keys.length, w, d, l, year); 
        }, 50);
    });

    // 창 닫기 버튼
    $('#log > div > button:nth-of-type(1)').off('click').on('click', function() {
        $('#log, #logBg').fadeOut(300);
        
        $('body').css('overflow', 'auto');
    });

    // 수정 버튼
    $('#log > div > button:nth-of-type(2)').click(function() {
        if (!currId) return;

        const y = currId.substring(0, 4);
        const m = currId.substring(4, 6);
        const d = currId.substring(6, 8);
        const dateStr = `${y}-${m}-${d}`;

        $('#log, #logBg').fadeOut(300);
        $('#addLog, #addLogBg').hide().fadeIn(300);

        addLog(data, matchlog, uid, dateStr);
    });

    // 삭제 버튼
    $('#log > div > button:nth-of-type(3)').off('click').on('click', function() {
        if (!currId) return;

        if (!confirm('정말 삭제하시겠습니까?')) {
            return;
        }

        remove(ref(db, `matchlog/${uid}/${currId}`))
            .then(() => {
                alert('기록이 삭제되었습니다.');

                delete matchlog[currId];

                $('#log, #logBg').fadeOut(300);
                $('body').css('overflow', 'auto');
                
                const currentYear = $('#matchlogSelect').val() || 0;
                getList(data, matchlog, currentYear);
            })
            .catch((error) => {
                console.error("삭제 실패:", error);
                alert('삭제 중 오류가 발생했습니다.');
            });
    });

    // 저장 버튼(임시)
    $('#log > div > button:nth-of-type(4)').click(function() {
        alert('저장 기능은 현재 준비 중입니다. 조금만 기다려 주세요.');
    });

    $('#matchlogBtn > button:nth-of-type(1)').trigger('click');
}

function getList(data, matchlog, year) {
    let w = 0, d = 0, l = 0, gsAll = 0, gcAll = 0, gsAttend = 0, gcAttend = 0;
    let monthAll = {};
    let oppAll = {};
    let stadiumAll = {};
    let monthAttend = {};
    let oppAttend = {};
    let stadiumAttend = {};

    for (let i = 1; i <= 12; i++) {
        monthAll[i] = 0;
        monthAttend[i] = 0;
    }

    const keys = (year == 0) ? Object.keys(data) : Object.keys(data).filter(y => y.substring(0, 4) == year);
    const matchKeys = (year == 0) ? Object.keys(matchlog) : Object.keys(matchlog).filter(y => y.substring(0, 4) == year);

    $('#matchlogList').empty();

    // 데이터 집계
    for (let i = 0; i < keys.length; i++) {
        const matchId = keys[i];

        if (!data[matchId]) {
            console.warn(`${matchId}에 해당하는 경기 정보가 dataA에 없습니다.`);
            continue;
        }

        const matchData = data[matchId];
        const homeScore = parseInt(matchData['homeScore'].replace(/<span[^>]*>.*?<\/span>/gi, ''));
        const awayScore = parseInt(matchData['awayScore'].replace(/<span[^>]*>.*?<\/span>/gi, ''));
        const isHome = (matchData['home'][1] == 'seouleland') ? 1 : 0;
        const opp = isHome ? matchData['away'][0] : matchData['home'][0];
        const st = matchData['stadium'] || '';
        const month = parseInt(matchId.substring(4, 6));

        monthAll[month]++;
        oppAll[opp] = (oppAll[opp] || 0) + 1;
        if (st != '') stadiumAll[st] = (stadiumAll[st] || 0) + 1;
        
        if (isHome) {
            gsAll += homeScore;
            gcAll += awayScore;
        } else {
            gsAll += awayScore;
            gcAll += homeScore;
        }

        if (matchlog[matchId]) {
            if (isHome) {
                if (homeScore > awayScore) w++;
                else if (homeScore < awayScore) l++;
            } else {
                if (homeScore < awayScore) w++;
                else if (homeScore > awayScore) l++;
            }
            if (homeScore == awayScore) d++;

            if (isHome) {
                gsAttend += homeScore;
                gcAttend += awayScore;
            } else {
                gsAttend += awayScore;
                gcAttend += homeScore;
            }

            monthAttend[month]++;
            oppAttend[opp] = (oppAttend[opp] || 0) + 1;
            if (st != '') stadiumAttend[st] = (stadiumAttend[st] || 0) + 1;

            $(`#matchlogList`).prepend(`
                <div id = '${matchId}' class='fixtures_' glass='true'>
                    <div>
                        <img src = './files/${matchData['comp'][1]}_s.png'>
                        <p transl='y'>${matchData['comp'][0]} ${matchData['round']}</p>
                    </div>
                    <div>
                        <div>
                            <div>
                                <img src = './files/${matchData['home'][1]}_s.png'>
                            </div>
                            <p transl='y'>${matchData['home'][0]}</p>
                        </div>
                        <div>
                            <p>${homeScore} : ${awayScore}</p>
                            <p glass='true'>${matchId.substring(4, 6)}.${matchId.substring(6, 8)}.${matchData['time'] ? ' ' + matchData['time'] : ''}</p>
                        </div>
                        <div>
                            <div>
                                <img src = './files/${matchData['away'][1]}_s.png'>
                            </div>
                            <p transl='y'>${matchData['away'][0]}</p>
                        </div>
                    </div>
                </div>
            `);

            if ((isHome && (homeScore > awayScore)) || (!(isHome) && (homeScore < awayScore))) {
                $(`.fixtures_:nth-of-type(1) > div:nth-of-type(2) > div:nth-of-type(2) > p:nth-of-type(2)`).css({ 'color': '#faf6f5', 'background': '#374df5c0', 'border': '1px solid #374df5c0' });
            } else if ((!(isHome) && (homeScore > awayScore)) || (isHome && (homeScore < awayScore))) {
                $(`.fixtures_:nth-of-type(1) > div:nth-of-type(2) > div:nth-of-type(2) > p:nth-of-type(2)`).css({ 'color': '#faf6f5', 'background': '#e0000060', 'border': '1px solid #e0000060' });
            } else {
                $(`.fixtures_:nth-of-type(1) > div:nth-of-type(2) > div:nth-of-type(2) > p:nth-of-type(2)`).css({ 'color': '#faf6f5', 'background': '#05090a40', 'border': '1px solid #05090a40' });
            }
        }
    }

    if (matchKeys.length == 0) $('#matchlogList').append('<p>직관 기록이 없어요.</p>');

    // 직관 횟수 표시
    $('#matchNum > div:nth-of-type(1) > p:nth-of-type(1)').text(`총 ${matchKeys.length}경기`);
    $('#matchNum > div:nth-of-type(1) > p:nth-of-type(2)').text(`${w}승 ${d}무 ${l}패`);

    // 승률 표시
    const rate = (w + d + l == 0) ? '' : (w / (w + d + l) * 100).toFixed(0);
    if (rate != '') $('#matchNum > p').html(rate + '<span>%</span>');
    else $('#matchNum > p').html('-&nbsp;&nbsp;');

    window.currentStats = { w, d, l };
    setGauge(keys.length, w, d, l, year);

    // 득실점 비교
    const defaultWidth = ($(window).width() < 768) ? 80 : 25;

    $('#matchStatList > div:nth-of-type(3) > div:nth-of-type(1) > div > p:nth-of-type(1)').text(`${gsAttend}득점`).css('width', `calc(${defaultWidth}vw * ${gsAttend / (gsAttend + gcAttend)} - 16px)`).css('padding', '8px 0 8px 16px');
    $('#matchStatList > div:nth-of-type(3) > div:nth-of-type(1) > div > p:nth-of-type(2)').text(`${gcAttend}실점`).css('width', `calc(${defaultWidth}vw * ${gcAttend / (gsAttend + gcAttend)} - 16px)`).css('padding', '8px 16px 8px 0');
    
    $('#matchStatList > div:nth-of-type(3) > div:nth-of-type(2) > div > p:nth-of-type(1)').text(`${gsAll - gsAttend}득점`).css('width', `calc(${defaultWidth}vw * ${(gsAll - gsAttend) / ((gsAll - gsAttend) + (gcAll - gcAttend))} - 16px)`).css('padding', '8px 0 8px 16px');
    $('#matchStatList > div:nth-of-type(3) > div:nth-of-type(2) > div > p:nth-of-type(2)').text(`${gcAll - gcAttend}실점`).css('width', `calc(${defaultWidth}vw * ${(gcAll - gcAttend) / ((gsAll - gsAttend) + (gcAll - gcAttend))} - 16px)`).css('padding', '8px 16px 8px 0');

    if (gsAttend == 0 && gcAttend == 0 && gsAttend == gsAll && gcAttend == gcAll) $('#matchStatList > div:nth-of-type(3)').css('display', 'none');
    else $('#matchStatList > div:nth-of-type(3)').css('display', 'flex');

    if (gsAttend == 0 && gcAttend == 0) $('#matchStatList > div:nth-of-type(3) > div:nth-of-type(1)').css('display', 'none');
    else $('#matchStatList > div:nth-of-type(3) > div:nth-of-type(1)').css('display', 'block');
    
    if (gsAttend == 0) $('#matchStatList > div:nth-of-type(3) > div:nth-of-type(1) > div > p:nth-of-type(1)').css({ 'width': 0, 'padding': '0' });
    else if (gcAttend == 0) $('#matchStatList > div:nth-of-type(3) > div:nth-of-type(1) > div > p:nth-of-type(2)').css({ 'width': 0, 'padding': '0' });
    
    if (gsAttend == gsAll && gcAttend == gcAll) $('#matchStatList > div:nth-of-type(3) > div:nth-of-type(2)').css('display', 'none');
    else $('#matchStatList > div:nth-of-type(3) > div:nth-of-type(2)').css('display', 'block');

    if (gsAttend == gsAll) $('#matchStatList > div:nth-of-type(3) > div:nth-of-type(2) > div > p:nth-of-type(1)').css({ 'width': 0, 'padding': '0' });
    else if (gcAttend == gcAll) $('#matchStatList > div:nth-of-type(3) > div:nth-of-type(2) > div > p:nth-of-type(2)').css({ 'width': 0, 'padding': '0' });

    // 가장 많이 만난 상대
    let oppBucket = [];

    for (const team in oppAttend) {
        let cnt = oppAttend[team];

        if (!oppBucket[cnt]) oppBucket[cnt] = [];

        oppBucket[cnt].push(team);
    }

    if (oppBucket.length > 0) {
        $('#matchStatList > div:nth-of-type(4)').css('display', 'flex');

        if (oppBucket[oppBucket.length - 1].length == 1) {
            $('#matchStatList > div:nth-of-type(4) > div:nth-of-type(1) > p:nth-of-type(1)').text(oppBucket[oppBucket.length - 1]);
            $('#matchStatList > div:nth-of-type(4) > div:nth-of-type(1) > p:nth-of-type(2)').text(`${oppBucket.length - 1}회`);
        } else {
            $('#matchStatList > div:nth-of-type(4) > div:nth-of-type(1) > p:nth-of-type(1)').html(oppBucket[oppBucket.length - 1].join('<br>'));
            $('#matchStatList > div:nth-of-type(4) > div:nth-of-type(1) > p:nth-of-type(2)').text(`${oppBucket.length - 1}회`);
        }

        $('#matchStatList > div:nth-of-type(4) > div:nth-of-type(2) > p > span').text(`${w + d + l}경기 중 ${((oppBucket.length - 1) / (w + d + l) * 100).toFixed(1)}%`);
    } else {
        $('#matchStatList > div:nth-of-type(4)').css('display', 'none');
    }

    // 가장 많이 간 경기장
    const excl = ['목동운동장', 'LEOUL PARK'];
    let stadiumBucket = [];

    for (const stadium in stadiumAttend) {
        if (excl.includes(stadium)) continue;

        let cnt = stadiumAttend[stadium];

        if (!stadiumBucket[cnt]) stadiumBucket[cnt] = [];

        stadiumBucket[cnt].push(stadium.split(' ')[0]);
    }

    if (stadiumBucket.length > 0) {
        $('#matchStatList > div:nth-of-type(5)').css('display', 'flex');

        if (stadiumBucket[stadiumBucket.length - 1].length == 1) {
            $('#matchStatList > div:nth-of-type(5) > div:nth-of-type(1) > p:nth-of-type(1)').text(stadiumBucket[stadiumBucket.length - 1]);
            $('#matchStatList > div:nth-of-type(5) > div:nth-of-type(1) > p:nth-of-type(2)').text(`${stadiumBucket.length - 1}회`);
        } else {
            $('#matchStatList > div:nth-of-type(5) > div:nth-of-type(1) > p:nth-of-type(1)').html(stadiumBucket[stadiumBucket.length - 1].join('<br>'));
            $('#matchStatList > div:nth-of-type(5) > div:nth-of-type(1) > p:nth-of-type(2)').text(`${stadiumBucket.length - 1}회`);
        }

        $('#matchStatList > div:nth-of-type(5) > div:nth-of-type(2) > p > span').html(`홈 경기장(${(stadiumAttend['목동운동장'] || 0) + (stadiumAttend['LEOUL PARK'] || 0)}회) 제외,<br>${w + d + l}경기 중 ${((stadiumBucket.length - 1) / (w + d + l) * 100).toFixed(1)}%`);
    } else {
        $('#matchStatList > div:nth-of-type(5)').css('display', 'none');
    }
}

